const ContentShop = (props) => {
  return (
    <div className="col-3 overflow-auto categoria">
      <div className="ml-3">
        <h1>Content Categoria</h1>
      </div>
      <div className="row ml-2">{props.children}</div>
    </div>
  );
};

export default ContentShop;
